Imajte na umu: Delovi ove aplikacije su namenjeni za upotrebu zdravstvenih radnika kao alat za podršku pri odlučivanju. Ne treba da ih koriste pacijenti i ne zamenjuju savet lekara.

Mediately Baza Lekova — Mobilni pomoćnik za bržu dijagnostiku i lečenje, sada na vašem iPhone i iPad.

Pomoću aplikacije možete lako da pretražujete u oflajn registru lekova sa više od 3.700 lekova i dobijete trenutni pristup interaktivnim kliničkim alatima i kalkulatorima doziranja. 

1. Pribavite informacije o više od 3.700 lekova

Za svaki lek možete da pogledate detaljne informacije, uključujući:

• Osnovne informacije o leku (aktivna supstanca, sastav, farmaceutski oblik, klasa, lista lekova);
• Važne informacije iz SmPC dokumenta o leku (indikacije, doziranje, kontraindikacije, interakcije, neželjeni efekti, predoziranje itd.);
• ATC klasifikacija i paralelni lekovi;
• Ambalaža i cene;
• Pristup kompletnom SmPC dokumentu u PDF formatu (potrebna je veza s internetom).

2 Pretražite širok opseg interaktivnih dijagnostičkih alata

Zajedno sa kompletnom bazom podataka o lekovima, aplikacija uključuje niz interaktivnih kliničkih alata i korisnih kalkulatora doziranja u vašoj svakodnevnoj praksi:

• BMI (indeks telesne mase);
• BSA (površina tela);
• CHA₂DS₂-VASc (rizik od moždanog udara skorom kod pacijenata s AF-om);
• GCS (Glazgovska skala kome);
• GFR (MDRD formula);
• HAS-BLED (visoki rizik od krvarenja kod pacijenata sa AF-om);
• MELD (model za završnu fazu jetre);
• PERC skor (kriterijumi za isključenje plućne embolije);
• Velsovi kriterijumi za plućnu emboliju.

Pronađite alate koje svakodnevno koriste hiljade lekara. 

Aplikacija takođe uključuje klasifikaciju bolesti ICD-10 i ATC sistem klasifikacije. Redovno ih ažuriramo, tako da uvek imate najnovije informacije.

Ova aplikacija je registrovana i regulisana od strane Slovenačkog regulatornog organa za lekove i medicinska sredstva i ima CE oznaku za usaglašenost kao medicinsko sredstvo. Modra Jagoda d.o.o. je sertifikovana prema standardu ISO 13485 za projektovanje i proizvodnju medicinskih uređaja.

Track baby feedings, diaper changes and sleep with clean & easy SuperMama app. Have less stress & more ‘me time’. Bond with your baby instead of trying to remember which breast side to feed from, when your little one pooped or how long it has been since the last nap.

We talked with new moms to understand their needs and wishes; that’s how we came up with the SuperMama app. It keeps all newborn’s data readily at hand and lets you be more organized. Besides standard events, you can log info about medicines, baths, allergies and make custom notes. SuperMama app can be a game changer for new parents. It helps you plan your day and gives you more time for yourself, if you’re a mompreneur, for example.

Here is what you can track with SuperMama:
* Breastfeeding:  log nursing time, set reminders and remember which side you last breastfed on (this is important to avoid plugged milk and mastitis);
* Breast pumping:  track the volume to be sure that there is enough milk pumped;
* Diaper changes:  take care of your baby’s delicate skin and keep track of his/her bowel movements;
* Bottle feeding:  log the volume of formula, pumped milk, water or juice;
* Sleep:  track duration, notice patterns and evaluate the quality of your little angel’s sleeps;
* Growth:  record baby’s weight, height and head circumference, update these numbers whenever you want and watch the progress with growth charts;
* Custom events:  choose from existing (meds, tummy time, complementary foods) or create your own. 

All data is presented in a slick and easily accessible way. There are also easy-to-read graphs which help to see important trends of baby’s development. We’ve created a tool that benefits mom, baby and dad (yes, he can track child’s activity too!), making those first months of parenting a stress-free experience. Have everything under control with SuperMama!
 
